import React from 'react';
import './App.css';
import BookForm from './Book/BookForm';
import BookList from './Book/BookList';
import BookSingle from './Book/BookSingle';

function App() {
  return (
    <div className="container-fluid">
      <div className="row">
        <div className="col s12">MENU</div>
      </div>
      <div className="row">
        <div className="col s12"><BookForm/></div>
      </div>
      <div className="row">
        <div className="col s12"><BookList/></div>
      </div>
      <div className="row">
        <div className="col s12"><BookSingle/></div>
      </div>
    </div>
  );
}

export default App;
